def chros_crossover(population_list, max_sublot, SPC_1_rate, SPC_2_rate, OMAC_rate, JLOSC_rate, SLOSC_rate):
    population_size = len(population_list)
    S = list(np.random.permutation(population_size)) # Generate a random sequence to select the parent chromosome to crossover
    
    # Create child:
    for m in range(population_size//2):
        parent_1 = population_list[S[m]]
        parent_2 = population_list[S[m*2+1]]
        
        child_1 = copy.deepcopy(parent_1)
        child_2 = copy.deepcopy(parent_2)
        
        # LHS Single point Crossover-1            
        if np.random.uniform(0,1)<SPC_1_rate:
            # Generate random Crossover point
            LHS_cutpoint_SPC_1 = np.random.randint(sum(max_sublot))
                # Flatten nested list to List
            flat_LHS_parent_1 = [item for sublist in parent_1['LHS'] for item in sublist]
            flat_LHS_parent_2 = [item for sublist in parent_2['LHS'] for item in sublist]                
            flat_LHS_child_1 =  flat_LHS_parent_2[0:LHS_cutpoint_SPC_1] + flat_LHS_parent_1[LHS_cutpoint_SPC_1:]
            flat_LHS_child_2 =  flat_LHS_parent_1[0:LHS_cutpoint_SPC_1] + flat_LHS_parent_2[LHS_cutpoint_SPC_1:]
                # Re-structured LHS
            child_1['LHS'] = [flat_LHS_child_1[sum(max_sublot[:i]): sum(max_sublot[:i]) + max_sublot[i]] for i in range(len(max_sublot))]
            child_2['LHS'] = [flat_LHS_child_2[sum(max_sublot[:i]): sum(max_sublot[:i]) + max_sublot[i]] for i in range(len(max_sublot))]
            
        # LHS Single point Crossover-2 (bi van de chi chay duoc 1 trong 2 cai thoi)            
        if np.random.uniform(0,1)<SPC_2_rate:
            # Generate random Crossover point
            LHS_cutpoint_SPC_2 = np.random.randint(sum(max_sublot))
                # Flatten nested list to List
            flat_LHS_parent_1 = [item for sublist in parent_1['LHS'] for item in sublist]
            flat_LHS_parent_2 = [item for sublist in parent_2['LHS'] for item in sublist]                
            flat_LHS_child_1 =  flat_LHS_parent_1[0:LHS_cutpoint_SPC_2] + flat_LHS_parent_2[LHS_cutpoint_SPC_2:]
            flat_LHS_child_2 =  flat_LHS_parent_2[0:LHS_cutpoint_SPC_2] + flat_LHS_parent_1[LHS_cutpoint_SPC_2:]
                # Re-structured LHS
            child_1['LHS'] = [flat_LHS_child_1[sum(max_sublot[:i]): sum(max_sublot[:i]) + max_sublot[i]] for i in range(len(max_sublot))]
            child_2['LHS'] = [flat_LHS_child_2[sum(max_sublot[:i]): sum(max_sublot[:i]) + max_sublot[i]] for i in range(len(max_sublot))]

        # RHS Operation to machine Assignment Crossover
        if np.random.uniform(0,1)<OMAC_rate:
            OMAC_pick_index = random.sample(range(len(parent_1['RHS'])), int(len(parent_1['RHS'])*OMAC_rate))
            OMAC_pick_index. sort()
            for i in OMAC_pick_index:
                for j in range(len(parent_2['RHS'])):
                    if child_1['RHS'][i][:3] == parent_2['RHS'][j][:3]:
                        child_1['RHS'][i][3] = parent_2['RHS'][j][3]
                
                for i in range(len(parent_1['RHS'])):
                    if child_2['RHS'][i][:3] == parent_1['RHS'][j][:3]:
                        child_2['RHS'][i][3] = parent_1['RHS'][j][3]        
        
        # RHS Job Level Operations sequence Crossover
        if np.random.uniform(0,1)<JLOSC_rate:
            JLOSC_pick_index = random.choice(range(len(parent_1['RHS'])))
            parent_1_pick_list = [parent_1['RHS'][i] for i in range(len(parent_1['RHS'])) if parent_2['RHS'][JLOSC_pick_index][0] != parent_1['RHS'][i][0]]
            parent_2_pick_list = [parent_1['RHS'][i] for i in range(len(parent_2['RHS'])) if parent_1['RHS'][JLOSC_pick_index][0] != parent_2['RHS'][i][0]]
            
            #Child 1 Creation
            for i in range(len(parent_1['RHS'])):
                if parent_1['RHS'][JLOSC_pick_index][0] == parent_1['RHS'][i][0]:
                    child_1['RHS'][i] = (parent_1['RHS'][i])
                else:
                    child_1['RHS'][i] = parent_2_pick_list[0]
                    del parent_2_pick_list[0]
            #Child 2 Creation
            for i in range(len(parent_2['RHS'])):
                if parent_2['RHS'][JLOSC_pick_index][0] == parent_2['RHS'][i][0]:
                    child_2['RHS'][i] = (parent_2['RHS'][i])
                else:
                    child_2['RHS'][i] = parent_1_pick_list[0]
                    del parent_1_pick_list[0]

        # RHS sub-lot Level Operations sequence Crossover
        if np.random.uniform(0,1)<SLOSC_rate:
            SLOSC_pick_index = random.choice(range(len(parent_1['RHS'])))
            parent_1_pick_list = [parent_1['RHS'][i] for i in range(len(parent_1['RHS'])) if parent_2['RHS'][SLOSC_pick_index][:2] != parent_1['RHS'][i][:2]]
            parent_2_pick_list = [parent_1['RHS'][i] for i in range(len(parent_2['RHS'])) if parent_1['RHS'][SLOSC_pick_index][:2] != parent_2['RHS'][i][:2]]
            
            #Child 1 Creation
            for i in range(len(parent_1['RHS'])):
                if parent_1['RHS'][SLOSC_pick_index][:2] == parent_1['RHS'][i][:2]:
                    child_1['RHS'][i] = (parent_1['RHS'][i])
                else:
                    child_1['RHS'][i] = parent_2_pick_list[0]
                    del parent_2_pick_list[0]
            #Child 2 Creation
            for i in range(len(parent_2['RHS'])):
                if parent_2['RHS'][SLOSC_pick_index][:2] == parent_2['RHS'][i][:2]:
                    child_2['RHS'][i] = (parent_2['RHS'][i])
                else:
                    child_2['RHS'][i] = parent_1_pick_list[0]
                    del parent_1_pick_list[0]
  
    return population_list
